issue.body:
### Description

S2589 is mistakenly reported for several case entries in a switch block.

### Repro steps

```cs
using System;

public static class Program
{
    private static readonly int Rounds = 23;

    private static void Main()
    {
        Run();
    }

    private static void Run()
    {
        for (var i = 1; i <= Rounds; i++)
        {
            switch (i)
            {
                case 1:
                case 4:
                case 7:
                case 10:
                case 13:
                case 16:
                    Console.WriteLine(i);
                    break;
                case 2:
                case 5:
                case 8:
                case 11:
                case 14:
                    Console.WriteLine(i);
                    break;
                case 3:
                case 6:
                case 9:
                case 12:
                case 15:
                    Console.WriteLine(i);
                    break;
                default:
                    break;
            }
        }
    }
}
```
### Expected behavior

S2589 is not reported.

### Actual behavior

The following diagnostics are reported:

Program.cs(28,22,28,23): error S2583: Change this condition so that it does not always evaluate to 'True'. Some code paths are unreachable. (https://rules.sonarsource.com/csharp/RSPEC-2583)
Program.cs(21,22,21,23): error S2589: Change this condition so that it does not always evaluate to 'False'. (https://rules.sonarsource.com/csharp/RSPEC-2589)
Program.cs(22,22,22,23): error S2589: Change this condition so that it does not always evaluate to 'False'. (https://rules.sonarsource.com/csharp/RSPEC-2589)
Program.cs(23,22,23,24): error S2589: Change this condition so that it does not always evaluate to 'False'. (https://rules.sonarsource.com/csharp/RSPEC-2589)
Program.cs(24,22,24,24): error S2589: Change this condition so that it does not always evaluate to 'False'. (https://rules.sonarsource.com/csharp/RSPEC-2589)
Program.cs(25,22,25,24): error S2589: Change this condition so that it does not always evaluate to 'False'. (https://rules.sonarsource.com/csharp/RSPEC-2589)Please provide a description of the actual behavior you observe.

### Known workarounds

None.

### Related information

* SonarAnalyzer.CSharp version: 9.12.0.78982
* Visual Studio version: 17.8.0 Preview 2.0

